INSERT INTO SummaryReport(summaryReportId,averageRating,generatedSummary,company,generatedBy,updatedBy) VALUES (36,4.6,'Tantum in alios caeco impetu incurrunt, sed intus etiam in animis nostris inesse notionem, ut alterum esse appetendum, alterum aspernandum sentiamus. Alii autem, quibus ego assentior.',14,120,120);
INSERT INTO SummaryReport(summaryReportId,averageRating,generatedSummary,company,generatedBy,updatedBy) VALUES (37,3.2,'Verum, opinor, scriptorem tamen, ut legendus sit. Rudem enim esse omnino in nostris poetis aut inertissimae segnitiae est aut fastidii delicatissimi. Mihi quidem nulli satis eruditi videntur, quibus nostra ignota sunt. An ''Utinam ne in nemore . . .'' nihilo minus legimus quam hoc.',3,110,110);
