INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart,isAnonymous,wouldRecommend) VALUES (1,'2024-06-12 05:36:18',46,10,609.97,3,'Soleat accuratius explicari; verum enim invenire volumus, non tamquam adversarium aliquem convincere. Accurate autem quondam a L. Torquato, homine omni doctrina erudito, defensa est Epicuri sententia de voluptate, nihil scilicet novi, ea tamen, quae te ipsum.','Amicis quam sibi, quibus non solum praesentibus fruuntur.','Legendum his esse potiora. Quid est cur dubitemus dicere et sapientiam propter voluptates expetendam et dolorem.',0,0);
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart,isAnonymous,wouldRecommend) VALUES (2,'2024-06-18 09:26:26',59,4,604.96,1,'Quid a singulis philosophiae disciplinis diceretur, persecuti sumus. Ut autem a facillimis ordiamur, prima veniat in medium Epicuri ratio, quae plerisque notissima est. Quam a nobis explicatam.','Etiam videmus, et perspicuum est nihil desiderare manum, cum ita esset affecta, secundum non recte, si voluptas esset.','Beate vivendum se ipsa allicit nec patientia nec assiduitas nec vigiliae nec ea.',1,0);
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart,isAnonymous,wouldRecommend) VALUES (3,'2024-07-26 05:46:48',39,3,476.55,3,'Molestia liberemus. Ut enim medicorum scientiam non ipsius artis, sed bonae valetudinis causa probamus, et gubernatoris ars, quia bene navigandi rationem habet, utilitate, non arte laudatur, sic sapientia, quae ars vivendi putanda est, non satis politus iis artibus, quas qui tenent, eruditi appellantur -- aut ne deterruisset alios.','Legendum his esse potiora. Quid est cur tam multos legant, quam legendi sunt.','Enim sentit, quem ad me accedis, saluto: ''chaere,'' inquam, ''Tite!'' lictores, turma omnis chorusque: ''chaere, Tite!'' hinc hostis.',1,1);
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart,isAnonymous,wouldRecommend) VALUES (4,'2024-05-11 11:36:21',45,24,427.72,5,'Graviter ornateque dictas quis non legat? Nisi qui se plane Graecum dici velit, ut a Scaevola est praetore salutatus Athenis Albucius. Quem quidem locum comit multa venustate et omni sale idem Lucilius, apud quem praeclare Scaevola: Graecum te, Albuci, quam Romanum atque Sabinum, municipem Ponti, Tritani, centurionum, praeclarorum hominum ac primorum signiferumque, maluisti dici. Graece ergo.','Laboramus, quis est, qui dolorem ipsum, quia dolor sit, amet, consectetur.','Libro, quo a nobis sic intelleges eitam, ut ab Homero Ennius, Afranius a Menandro solet.',0,1);
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart,isAnonymous,wouldRecommend) VALUES (5,'2024-04-04 14:43:25',40,19,408.59,2,'Agam, ut ipsi auctori huius disciplinae placet: constituam, quid.','Dixi, constituto, ut aut reiciendis voluptatibus maiores alias consequatur aut perferendis doloribus asperiores repellat. Hanc ego cum teneam sententiam, quid est cur tam multi sint Epicurei, sunt aliae quoque causae, sed multitudinem haec.','Cum dixissem, magis ut illum provocarem quam ut ipse loquerer, tum Triarius.',1,0);
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart,isAnonymous,wouldRecommend) VALUES (6,'2024-11-05 21:08:37',45,26,513.87,4,'Liberemus. Ut enim aeque doleamus.','Quae non modo non repugnantibus, verum etiam approbantibus nobis. Sic enim ab Epicuro reprehensa et correcta permulta. Nunc dicam de voluptate, a meque ei.','Mediocriterne delectat, cum tractat locos ab Aristotele ante tractatos? Quid? Epicurei num desistunt de isdem, de quibus neque depravate iudicant neque corrupte, nonne ei maximam gratiam habere debemus, qui hac exaudita quasi voce.',0,1);
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart,isAnonymous,wouldRecommend) VALUES (7,'2024-02-05 07:55:53',43,10,470.34,2,'Disserendi locus. Nunc autem explicabo.','Si illa mala sint, laetitia, si bona. O praeclaram beate vivendi et apertam et simplicem et directam viam! Cum enim certe nihil homini possit melius esse quam Graecam. Quando enim nobis, vel dicam aut oratoribus bonis.','Constituam, quid et quale sit id, de quo quaerimus, non quo ignorare vos arbitrer, sed ut ratione et via procedat oratio. Quaerimus igitur, quid sit extremum et ultimum bonorum, quod.',1,1);
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart,isAnonymous,wouldRecommend) VALUES (8,'2024-01-07 13:33:16',38,9,378.52,3,'Molestiam plus aut ad miseram vitam afferre momenti quam eorum utrumvis, si aeque diu sit in.','Praetermittatur quod vitam adiuvet, quo facilius id, quod quaeritur, sit pulcherrimum.','Non nulli patriam, plerique autem se ipsos amentur. Etenim si delectamur, cum scribimus, quis est tam invidus, qui ab eo et gravissimas res consilio ipsius et ratione administrari neque maiorem voluptatem ex hoc facillime perspici potest.',0,0);
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart,isAnonymous,wouldRecommend) VALUES (9,'2024-04-09 22:31:18',37,20,563.93,3,'Physicis et fortitudo sumitur contra.','Salutandi causa uterque venisset, pauca primo inter nos de litteris, quarum summum erat in utroque studium, deinde Torquatus: Quoniam nacti te, inquit, sumus aliquando otiosum, certe audiam, quid sit, quod Epicurum nostrum non tu quidem oderis, ut fere faciunt, qui ab eo ortum, tam inportuno tamque crudeli; sin, ut dolore suo sanciret militaris imperii disciplinam exercitumque.','Est usus Epicurus? Qui unum genus posuit earum cupiditatum, quae essent et naturales et necessariae, alterum, quae naturales essent nec.',0,0);
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart,isAnonymous,wouldRecommend) VALUES (10,'2024-03-14 10:07:10',58,26,512.03,2,'Faciam igitur, inquit: unam rem explicabo, eamque maximam, de.','Quae percipitur omni dolore careret, non modo non inopem, ut vulgo putarent, sed locupletiorem etiam esse quam Graecam. Quando enim nobis, vel dicam aut oratoribus bonis aut poetis, postea quidem quam fuit quem imitarentur, ullus orationis vel copiosae vel elegantis ornatus defuit? Ego vero, quoniam forensibus operis, laboribus, periculis non deseruisse mihi videor praesidium, in quo.','Perdiderunt, sic robustus animus et a spe pariendarum voluptatum seiungi non potest. Atque ut odia, invidiae, despicationes adversantur voluptatibus, sic amicitiae.',1,1);
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart,isAnonymous,wouldRecommend) VALUES (11,'2024-04-13 21:21:06',53,25,463.67,4,'Modo efficiatur concludaturque ratio tradit, non qua via captiosa solvantur ambigua distinguantur ostendit; iudicia rerum in sensibus ponit.','Ad commodius disserendum viam. In physicis plurimum posuit.','Et nostrum scribendi ordinem adiungimus, quid habent, cur Graeca anteponant iis, quae et a spe pariendarum voluptatum seiungi non potest. Atque ut odia, invidiae.',1,1);
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart,isAnonymous,wouldRecommend) VALUES (12,'2024-01-08 23:10:06',34,19,400.72,4,'Torquatos nostros? Quos tu paulo ante collegi, abest plurimum et, cum stultorum.','Esse e corpore et ad tranquillitatem ferant, quid est cur verear, ne ad.','Animo inbecilloque ferre miserum est, ob eamque debilitatem animi multi parentes, multi.',1,0);
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart,isAnonymous,wouldRecommend) VALUES (13,'2024-11-11 19:13:15',47,20,547.32,1,'Discordiae, seditiones, bella nascuntur, nec eae se foris solum iactant nec tantum in alios caeco impetu incurrunt, sed intus etiam in animis.','Ut ab ea nullo modo probantur, tamen Democritum laudatum a ceteris ab hoc, qui eum unum secutus esset, nollem vituperatum. Iam in altera philosophiae parte. Quae est quaerendi.','Mihi quidem videtur. Ac fieri potest, ut non modo numquam nocet cuiquam, sed contra semper afficit cum vi sua atque natura, quod tranquillat animos, tum spe nihil earum rerum defuturum, quas natura non.',0,0);
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart,isAnonymous,wouldRecommend) VALUES (14,'2024-08-07 03:10:53',45,24,384.21,1,'Quo offendimur, dolor, doloris omnis privatio recte nominata est voluptas. Ut enim, cum cibo et potione fames sitisque depulsa est, ipsa detractio molestiae consecutionem.','Si vero molita quippiam est, quamvis occulte fecerit, numquam tamen id volunt fieri, difficilem quandam temperantiam postulant in eo, quod semel admissum coerceri reprimique non potest, ut propemodum.','Sapientium non beatus. Multoque hoc melius nos veriusque quam Stoici. Illi enim negant esse bonum iucunde vivere. Id qui in.',0,0);
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart,isAnonymous,wouldRecommend) VALUES (15,'2023-12-04 17:31:27',59,23,406.70,5,'Multa sunt, sic inprobitas si cuius in animo versatur, numquam sinit eum respirare, numquam adquiescere. Quodsi ne ipsarum quidem virtutum laus, in qua maxime ceterorum philosophorum exultat oratio, reperire exitum potest, nisi derigatur ad voluptatem, voluptas autem est sola, quae.','Si probarem, quae ille diceret? Cum praesertim illa perdiscere ludus esset. Quam ob rem voluptas expetenda, fugiendus dolor sit. Sentiri haec putat, ut calere ignem, nivem esse albam, dulce mel. Quorum nihil oportere exquisitis rationibus confirmare.','Dictum sit. Erit enim iam de omnium virtutum cursu ad voluptatem proprius disserendi locus. Nunc autem explicabo, voluptas.',1,0);
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart,isAnonymous,wouldRecommend) VALUES (16,'2024-07-04 14:31:11',47,28,450.48,4,'Quae autem inanes sunt, iis parendum non est. Nihil enim desiderabile concupiscunt, plusque in ipsa iniuria detrimenti est quam in.','Dolores suscipiantur maiorum dolorum effugiendorum gratia. Sed de clarorum hominum factis illustribus et gloriosis satis hoc loco dictum sit. Erit enim iam de omnium virtutum cursu ad voluptatem proprius disserendi locus. Nunc autem explicabo, voluptas ipsa quae qualisque sit, ut tollatur error omnis imperitorum intellegaturque ea, quae dixi.','Animum excruciant et semper sollicitant turbulentaeque sunt.',1,0);
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart,isAnonymous,wouldRecommend) VALUES (17,'2023-12-27 16:21:47',33,28,592.11,5,'Copulationes et adhaesiones atomorum inter se, ex quo vitam amarissimam necesse est in voluptate est. Extremum autem esse bonorum eum voluptate vivere. Huic certae stabilique sententiae quae sint quaeque cernantur, omnia, eumque motum atomorum nullo a.','Morbos gravis, tum in morbos gravis, tum in dedecora incurrunt, saepe etiam.','Moveat, nulla successerit, eoque intellegi potest quanta voluptas sit non dolere. Sed ut perspiciatis, unde omnis iste natus error sit voluptatem accusantium doloremque laudantium, totam rem aperiam eaque ipsa, quae ab illo inventore veritatis et quasi architecto beatae vitae disciplinam.',1,0);
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart,isAnonymous,wouldRecommend) VALUES (18,'2024-10-08 21:10:07',47,3,443.60,4,'Et harum quidem rerum facilis est et ad usus civium non inutile.','Maximam, de physicis alias, et quidem.','Molestias accessio potest fieri, quanta ad augendas, cum conscientia factorum, tum poena legum odioque civium? Et tamen in quibusdam neque pecuniae modus est ullus investigandi veri, nisi inveneris, et quaerendi defatigatio turpis est, cum id, quod maxime placeat, facere possimus, omnis voluptas.',0,1);
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart,isAnonymous,wouldRecommend) VALUES (19,'2024-05-06 13:58:02',56,24,600.84,1,'Certe non probes, eum quem ego arbitror unum vidisse verum maximisque erroribus animos hominum liberavisse et omnia tradidisse, quae pertinerent ad bene beateque vivendo.','Adest, turbulenta est; si vero molita quippiam est, quamvis occulte fecerit, numquam tamen id volunt fieri, difficilem quandam temperantiam postulant in eo, quod sit a dolore corporis praesenti futurove seiunctum. Nec vero quisquam stultus non horum morborum aliquo laborat, nemo igitur est.','Male, credo, mererer de meis civibus, si ad eorum cognitionem divina illa ingenia transferrem. Sed id neque feci adhuc nec mihi tamen, ne faciam, interdictum puto. Locos quidem quosdam, si videbitur, transferam.',0,1);
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart,isAnonymous,wouldRecommend) VALUES (20,'2023-12-28 07:53:22',50,6,621.78,5,'Ante collegi, abest plurimum et, cum stultorum vitam cum sua comparat, magna afficitur voluptate. Dolores autem si qui incurrunt, numquam vim tantam.','Generibusque earum explicatis, et, ut modo docui, cognitionis regula et iudicio ab eadem illa.','Accessio potest, si aliquod aeternum et infinitum impendere malum nobis opinemur. Quod idem licet transferre in voluptatem, ut ea maior sit, mediocritatem desiderent. Sive enim ad minima veniam, quis nostrud exercitation ullamco laboris nisi ut aliquid ex ea commodo consequat. Duis aute.',0,1);
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart,isAnonymous,wouldRecommend) VALUES (21,'2023-12-04 12:47:43',54,6,614.43,4,'Inferiorem locum petentium sine causa eripuit atomis nec tamen id, cuius causa haec finxerat, assecutus est. Nam si omnes atomi declinabunt, nullae umquam cohaerescent, sive aliae declinabunt, aliae suo nutu recte ferentur, primum erit hoc quasi, provincias atomis dare, quae.','De amicitia, quam, si voluptas esset bonum, desideraret.'' -- Ita credo. -- ''Non est.','Confirmavit animum, ne quod aut sempiternum aut diuturnum timeret malum, quae.',1,0);
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart,isAnonymous,wouldRecommend) VALUES (22,'2024-04-01 01:40:27',55,10,410.37,3,'Naturales essent nec tamen necessariae, tertium, quae nec naturales nec necessariae. Quarum ea ratio est, ut Epicuro placet, nihil dolere, primum tibi recte, Chrysippe, concessum est nihil ad.','Utuntur, benivolentiam sibi conciliant et, quod aptissimum est ad cognitionem omnium, regula, ad quam omnia iudicia rerum in sensibus ponit, quibus si.','Locis pluribus. Sed quot homines, tot sententiae; falli igitur possumus. Quam ob rem dissentientium inter se dissident atque discordant, ex quo.',1,1);
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart,isAnonymous,wouldRecommend) VALUES (23,'2024-04-26 16:57:29',57,26,511.90,3,'Efficere possimus, molestia liberemus. Ut enim medicorum scientiam non ipsius artis, sed bonae valetudinis causa probamus, et gubernatoris ars, quia bene navigandi rationem habet, utilitate, non arte laudatur, sic sapientia, quae ars vivendi putanda est, non satis politus iis artibus, quas qui tenent, eruditi.','Requietis, mediocrium nos esse dominos, ut, si tolerabiles sint, feramus, si minus, animo aequo e vita, cum ea non placeat, tamquam e theatro exeamus. Quibus rebus intellegitur nec.','Ad lineam, hunc naturalem esse omnium corporum motum. Deinde ibidem homo acutus, cum illud ocurreret, si omnia dixi hausta e fonte naturae, si tota oratio nostra omnem sibi fidem sensibus confirmat, id est corpora individua propter soliditatem, censet in infinito inani, in quo etiam.',0,1);
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart,isAnonymous,wouldRecommend) VALUES (24,'2024-11-14 08:29:28',43,5,458.16,5,'Amorem efflorescere tantum, ut, etiamsi nulla sit utilitas ex amicitia, tamen ipsi amici propter se expetendam esse dicemus, sed quia consequuntur magni dolores eos.','Nobis, aequi esse debent, quod et posse fieri intellegimus et saepe etiam videmus, et perspicuum est nihil ad Epicurum. Nam si dicent ab illis has res esse.','In ipsa iniuria detrimenti est quam in iis corrigere voluit, deteriora fecit. Disserendi artem nullam habuit. Voluptatem cum summum bonum diceret, primum in eo.',1,0);
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart,isAnonymous,wouldRecommend) VALUES (25,'2024-01-26 00:44:48',33,30,546.27,5,'Complexiones et copulationes et adhaesiones atomorum inter se, ex quo efficeretur mundus omnesque.','Pro suis suscipit, ut non modo singulos homines, sed universas familias evertunt, totam etiam labefactant saepe rem publicam. Ex cupiditatibus odia, discidia, discordiae, seditiones, bella nascuntur, nec eae se foris solum iactant.','Antiopam Pacuvii spernat aut reiciat, quod se isdem Euripidis fabulis delectari dicat, Latinas litteras oderit? Synephebos ego, inquit, potius Caecilii aut Andriam.',0,0);
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart,isAnonymous,wouldRecommend) VALUES (26,'2023-12-10 06:19:57',50,15,519.15,3,'Nam neque laborum perfunctio neque perpessio dolorum per se ipsam optabilem, sed quia non.','Et quidem tibi et declinationem istam atomorum et magnitudinem solis.','Ego autem mirari satis non queo unde hoc sit tam insolens domesticarum rerum fastidium. Non est omnino hic docendi locus; sed ita prorsus existimo, neque eum Torquatum, qui hoc primus cognomen invenerit, aut torquem illum hosti detraxisse, ut aliquam ex eo credo quibusdam usu venire; ut abhorreant a Latinis, quod inciderint in.',1,1);
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart,isAnonymous,wouldRecommend) VALUES (27,'2024-06-07 05:51:00',34,2,609.82,4,'Posse a voluptate aut a voluptate aut a dolore. Quod cum ita sit, perspicuum est omnis rectas res atque laudabilis.','Et natura orationis et consequentium repugnantiumve ratio potest perspici. Omnium autem rerum natura duo quaerenda sint.','Investigandi veri, nisi inveneris, et quaerendi defatigatio turpis est, cum esset accusata et vituperata ab Hortensio. Qui liber cum et tibi probatus videretur et iis, quos ego posse.',0,1);
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart,isAnonymous,wouldRecommend) VALUES (28,'2024-05-02 12:46:42',45,29,547.61,5,'Cum teneam sententiam, quid est cur verear, ne ad eam non possim accommodare Torquatos nostros? Quos tu paulo ante collegi, abest plurimum et, cum.','Quidem consilio, tuum iudicium ut cognoscerem, quoniam mihi ea facultas, ut id apte fieri possit, ut ab ea nullo modo poterimus sensuum iudicia defendere. Quicquid porro animo cernimus, id omne oritur a sensibus; qui si omnes.','Fugienda est, summum profecto malum est vivere cum dolore, cui sententiae consentaneum est ultimum.',0,1);
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart,isAnonymous,wouldRecommend) VALUES (29,'2024-01-25 15:01:23',32,15,548.27,4,'Sola voluptas esset, quae quasi delapsa de caelo est ad quiete vivendum, caritatem, praesertim cum omnino nulla sit causa peccandi. Quae.','Soliditatem, censet in infinito inani, in quo etiam Democritus haeret, turbulenta concursio hunc mundi ornatum.','Placeat, tamquam e theatro exeamus. Quibus rebus intellegitur nec intemperantiam propter se ipsos amentur. Etenim si loca, si fana, si urbes, si gymnasia, si campum, si canes, si equos, si ludicra exercendi aut.',0,0);
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart,isAnonymous,wouldRecommend) VALUES (30,'2024-08-26 06:27:09',33,27,399.24,3,'Dolor sit. Sentiri haec putat, ut calere ignem, nivem esse albam, dulce mel. Quorum nihil oportere exquisitis rationibus confirmare, tantum satis esse admonere. Interesse.','Numquam ullius oratione victi sententia desistemus. Nisi autem rerum natura perspecta erit, nullo modo nec divelli nec distrahi possint, sic de iustitia iudicandum est, quae non modo non inopem, ut.','Consumeret, in quibus sequitur Democritum, non fere labitur. Quamquam utriusque cum multa non probo, inquam. De cetero vellem equidem aut ipse doctrinis fuisset instructior -- est enim, quod.',0,0);
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart,isAnonymous,wouldRecommend) VALUES (31,'2024-07-26 22:11:47',60,19,414.39,5,'Esse omnino in nostris poetis aut inertissimae segnitiae est aut fastidii delicatissimi. Mihi quidem videtur.','Omnisque puerilis est delectatio, aut se, ut.','Et gubernatoris ars, quia bene navigandi rationem habet, utilitate, non arte laudatur, sic sapientia, quae ars vivendi putanda est, non satis.',0,0);
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart,isAnonymous,wouldRecommend) VALUES (32,'2024-06-25 17:57:57',33,23,382.12,4,'Veri, nisi inveneris, et quaerendi defatigatio turpis est, cum id, quod sentiant non esse faciendum, ii voluptatem maximam adipiscuntur praetermittenda voluptate. Idem etiam dolorem saepe perpetiuntur, ne.','Compositis, quid est, cur nostri a nostris de amicitia dicenda sunt. Praeclare enim Epicurus his paene verbis: ''Eadem'', inquit, ''scientia confirmavit animum, ne quod aut sempiternum aut.','Itaque negat opus esse ratione neque.',1,0);
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart,isAnonymous,wouldRecommend) VALUES (33,'2024-02-13 17:05:03',46,10,549.95,4,'Arbitror unum vidisse verum maximisque erroribus animos hominum liberavisse et.','Ut aliquid ex ea commodo.','Vero, quoniam forensibus operis, laboribus, periculis non deseruisse.',0,0);
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart,isAnonymous,wouldRecommend) VALUES (34,'2024-09-24 13:59:11',55,29,432.99,4,'Tam expetendas, quam nostras expeteremus, quo loco videtur quibusdam.','Vult ''fodere aut arare aut aliquid ferre denique'' -- non enim illum.','Intellegunt totam rationem everti, si ita res.',1,0);
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart,isAnonymous,wouldRecommend) VALUES (35,'2024-02-08 14:10:46',39,15,605.61,4,'Mutans, sed ita, ut ea, quae corrigere vult, mihi quidem depravare videatur. Ille atomos quas appellat, id est laborum et dolorum fuga. Et harum quidem rerum facilis est et expedita distinctio. Nam libero tempore, cum soluta nobis est eligendi optio, cumque nihil impedit, quo minus animus a se repellere, idque facere nondum.','Locus huic disputationi vel maxime necessarius de amicitia, quam, si voluptas summum sit bonum, affirmatis nullam omnino fore. De qua omne certamen est? Tuo vero id quidem, inquam, arbitratu. Sic faciam igitur, inquit.','Et quaerendi defatigatio turpis est, cum esset accusata et vituperata ab Hortensio. Qui liber cum et mortem contemnit, qua qui est imbutus quietus esse numquam potest. Praeterea.',0,1);
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart,isAnonymous,wouldRecommend) VALUES (36,'2023-12-16 20:49:04',58,30,609.98,4,'Chremes non inhumanus, qui novum vicinum non vult ''fodere aut arare aut aliquid ferre denique'' -- non enim illum ab industria, sed ab inliberali labore deterret.','De quo quaerimus, non quo ignorare vos.','Nos abducat? Sin laboramus, quis est, qui alienae modum statuat industriae? Nam ut Terentianus Chremes non inhumanus, qui novum vicinum non vult ''fodere aut arare aut aliquid ferre denique'' -- non enim illum ab industria, sed ab inliberali labore deterret --, sic isti curiosi, quos offendit noster minime nobis iniucundus labor. Iis igitur est difficilius satis.',0,1);
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart,isAnonymous,wouldRecommend) VALUES (37,'2024-01-07 15:10:27',43,27,573.12,2,'Excepteur sint occaecat cupidatat non proident, sunt in culpa qui.','Quem quidem locum comit multa venustate et omni sale idem Lucilius, apud quem praeclare Scaevola: Graecum te, Albuci, quam Romanum atque Sabinum, municipem Ponti, Tritani, centurionum, praeclarorum hominum ac primorum signiferumque, maluisti dici. Graece ergo praetor Athenis, id quod maluisti, te, cum.','Atilii mihi legendam putem, de quo Lucilius.',1,0);
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart,isAnonymous,wouldRecommend) VALUES (38,'2024-04-21 08:36:34',47,12,603.89,2,'Omnis chorusque: ''chaere, Tite!'' hinc hostis mi Albucius, hinc inimicus. Sed iure Mucius. Ego autem mirari satis non queo unde hoc sit tam insolens domesticarum rerum fastidium. Non est omnino hic docendi locus; sed ita sentio et saepe disserui, Latinam linguam non modo non.','Voluptate discedere. Nam cum solitudo et vita sine amicis insidiarum et metus plena sit, ratio ipsa monet amicitias.','Vituperandae, maledicta, contumeliae, tum iracundiae, contentiones concertationesque in disputando pertinaces indignae philosophia mihi videri solent. Tum Torquatus: Prorsus, inquit, assentior; neque enim tempus est ullum, quo non plus voluptatum habeat quam dolorum. Nam et ipsa declinatio.',0,0);
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart,isAnonymous,wouldRecommend) VALUES (39,'2023-12-12 11:59:08',42,9,586.85,2,'Successerit, at contra gaudere nosmet omittendis doloribus.','Levis, in gravitate brevis soleat esse, ut eius magnitudinem celeritas, diuturnitatem allevatio consoletur. Ad ea cum accedit, ut neque divinum numen horreat nec praeteritas voluptates effluere patiatur earumque assidua recordatione laetetur, quid est, quod huc possit, quod melius sit.','Et ab Epicuro reprehensa et.',0,1);
INSERT INTO Review(reviewId,createdAt,createdBy,role,salary,rating,summary,bestPart,worstPart,isAnonymous,wouldRecommend) VALUES (40,'2024-11-08 22:20:51',51,15,448.29,2,'Atque haec ratio late patet. In quo enim maxime consuevit iactare vestra se oratio, tua praesertim, qui studiose antiqua persequeris, claris et fortibus viris commemorandis eorumque factis non emolumento aliquo, sed ipsius honestatis decore laudandis, id.','In physicis, quibus maxime gloriatur, primum totus.','Enim aut utilior aut ad beatam aut ad beatam aut ad beatam aut ad miseram vitam afferre momenti quam eorum utrumvis.',1,0);
